const ContactForm = () => {
  const classes = useStyles();
  const alert = useAlert();
  const history = useHistory();
  const handleCall = () => {
    window.location.href = "tel:+8171280446";
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert.success("Your message has been sent successfully");
    history.push("/");
  };

  return (
    <Box className={classes.root_contactus}>
      <div style={{ marginTop: "-15px" }}>
        <img src={require("../Image/breadcrumbnew/contact-us.jpg")} alt="" />
      </div>
      <MetaData title={"Contact Us"} />
      <div className={classes.contact_Container_contactus}>
        <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
          <Grid item xs={6}>
            <Typography variant="h2" className={classes.title_contact_us}>
              Contact Us
            </Typography>

            <Divider className={classes.divider_contact} />

            <Typography variant="h4" className={classes.helpTitle_contact_us}>
              Need Help?
            </Typography>
            <Typography variant="body2" className={classes.para_contact}>
              Catch us anytime you want? Fill out our support form below, and
              we'll be in touch shortly.
            </Typography>

            <Typography variant="body2" className={classes.address_contacts}>
              <span style={{ fontWeight: "500", paddingBottom: "0.5rem" }}>
                Learning Needs River Side Road
              </span>
              <br />
              Dakshinpara 24 Paraganas North Kolkata
              <br />
              West Bengal , Pin 743133
              <br />
              India
            </Typography>
            <Typography
              variant="body2"
              className={classes.para_contact}
              style={{ marginTop: "2rem" }}
            >
              We have live chat available, look for the chat icon in the lower
              right hand corner of this page. If it isnâ€™t there, then give us a
              call at{" "}
              <strong
                style={{
                  textDecoration: "underline",
                  cursor: "pointer",
                }}
                onClick={handleCall}
              >
                900702228
              </strong>
              .
            </Typography>
            <div className={classes.buttonGroup}>
              <a href="#issue-select" style={{ textDecoration: "none" }}>
                <Button variant="contained" className={classes.supportButton}>
                  Support Form
                </Button>
              </a>

              <Button
                variant="contained"
                className={classes.callButton}
                onClick={handleCall}
              >
                Call Us
              </Button>
            </div>

            <Divider className={classes.divider_contact} />
          </Grid>
          <Grid item xs={6}>
            <div className={classes.supportForm}>
              <Typography
                variant="h4"
                className={classes.title_contact_us}
                style={{ paddingBottom: "1rem" }}
              >
                Support Form
              </Typography>

              <Typography variant="body2" className={classes.para_contact}>
                Need a quicker answer? Look for our chat icon on the right hand
                side of this page.
              </Typography>

              <form
                className={classes.formContainer_container}
                onSubmit={handleSubmit}
              >
                <div className={classes.SelectOption_contact}>
                  <Typography
                    variant="body2"
                    className={classes.lableText_contact}
                  >
                    ISSUE *
                  </Typography>
                  <FormControl className={classes.formField_contact}>
                    <Select
                      labelId="issue-label"
                      id="issue-select"
                      defaultValue="e-commerce"
                      MenuProps={{
                        classes: { paper: classes.menu_contact },
                      }}
                    >
                      <MenuItem value="e-commerce">E-Commerce</MenuItem>
                      <MenuItem value="app">App</MenuItem>
                    </Select>
                  </FormControl>
                </div>

                <div className={classes.SelectOption_contact}>
                  <Typography
                    variant="body2"
                    className={classes.lableText_contact}
                  >
                    DETAIL *
                  </Typography>
                  <FormControl className={classes.formField_contact}>
                    <Select
                      labelId="detail-label"
                      id="detail-select"
                      defaultValue="others"
                      MenuProps={{
                        classes: { paper: classes.menu_contact },
                      }}
                    >
                      <MenuItem value="availability">Availability</MenuItem>
                      <MenuItem value="return/exchange">
                        Return/Exchange
                      </MenuItem>
                      <MenuItem value="technical-support">
                        Technical Support
                      </MenuItem>
                      <MenuItem value="invoicing">Invoicing</MenuItem>
                      <MenuItem value="tracking-info">Tracking Info</MenuItem>
                      <MenuItem value="others">Others</MenuItem>
                    </Select>
                  </FormControl>
                </div>

                <div className={classes.SelectOption_contact}>
                  <Typography
                    variant="body2"
                    className={classes.lableText_contact}
                  >
                    Language *
                  </Typography>
                  <FormControl className={classes.formField_contact}>
                    <Select
                      labelId="language-label"
                      id="language-select"
                      defaultValue="english"
                      MenuProps={{
                        classes: { paper: classes.menu_contact },
                      }}
                    >
                      <MenuItem value="english" className="menu_color">
                        English
                      </MenuItem>
                      <MenuItem value="hindi">Hindi</MenuItem>
                    </Select>
                  </FormControl>
                </div>

                <div className={classes.SelectOption_contact}>
                  <Typography
                    variant="body2"
                    className={classes.lableText_contact}
                  >
                    {" "}
                    EMAIL *
                  </Typography>
                  <FormControl className={classes.formField_contact}>
                    <TextField
                      placeholder="Enter Your Email *"
                      id="email-input"
                      type="email"
                    />
                  </FormControl>
                </div>

                <div className={classes.SelectOption_contact}>
                  <Typography
                    variant="body2"
                    className={classes.lableText_contact}
                  >
                    {" "}
                    MESSAGE *
                  </Typography>
                  <FormControl className={classes.formField_contact}>
                    <TextField
                      id="message-textarea"
                      multiline
                      rows={6}
                      variant="outlined"
                      placeholder="Enter Your Message *"
                    />
                  </FormControl>
                </div>
                <Button
                  type="submit"
                  variant="contained"
                  className={classes.submitButtons}
                >
                  Submit
                </Button>
              </form>
            </div>
          </Grid>
        </Grid>

        {/* <Typography variant="body2" className={classes.para_contact}>
          <span className={classes.para2}>7:00-6:00 MST Monday-Friday</span>
          <br />
          <span className={classes.para2}>9:00-4:00 MST Saturday</span>
          <br />
          <span className={classes.para2}>Closed Sunday</span>
        </Typography> */}

        <div className="map" style={{ marginTop: "5rem" }}>
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <iframe
                title="Map"
                src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7357.968950458062!2d88.34003244148784!3d22.765957410437817!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x39f89ae7d9e2af4d%3A0xc1c528ba5408617!2sLearning%20Needs!5e0!3m2!1sen!2sin!4v1693437333599!5m2!1sen!2sin"
                width="100%"
                height="450"
                style={{ border: "0" }}
                allowfullscreen=""
                loading="lazy"
                referrerpolicy="no-referrer-when-downgrade"
              ></iframe>
            </Grid>
          </Grid>
        </div>
      </div>
    </Box>
  );
};

export default ContactForm;
